import React from 'react'

export default class Login extends React.Component {
  render() {
    return(
      <div style={styleLogin}>
        <p>Sign in Below!</p>
        <div>
        <input type="text"/>
        <input type="submit" value="Click to Login"/>
        </div>
      </div>
    )
  }
}

const styleLogin = {
  display: "flex", 
  flexDirection: "column",
  textAlign: "center",
  padding: "2em",
  background: "#ced7db",
  borderRadius: "1em"
}
